import React from "react";

const Movies = (props) => {
  const { movies, count } = props;

  return (
    <>
      <ul>
        {movies.map((movie) => {
          return `<li key=${movie.id}>${movie.title}</li>`;
        })}
      </ul>
    </>
  );
};

export default Movies;
